func maximumScore(nums []int, k int) int {
    const mod = 1e9 + 7
    n := len(nums)
    primeScores := make([]int, n)

    // Calculate prime score for each number
    for i, num := range nums {
        primeScores[i] = primeScore(num)
    }

    // Sort indices based on prime score and value
    indices := make([]int, n)
    for i := range indices {
        indices[i] = i
    }
    sort.Slice(indices, func(i, j int) bool {
        if primeScores[indices[i]] == primeScores[indices[j]] {
            return nums[indices[i]] > nums[indices[j]]
        }
        return primeScores[indices[i]] > primeScores[indices[j]]
    })

    score := 1
    for i := 0; i < k; i++ {
        score = (score * nums[indices[i]]) % mod
    }

    return score
}

func primeScore(num int) int {
    score := 0
    for i := 2; i*i <= num; i++ {
        if num%i == 0 {
            score++
            for num%i == 0 {
                num /= i
            }
        }
    }
    if num > 1 {
        score++
    }
    return score
}
